             <resourceAssignmentExpression>\r\n                    <formalExpression>${bpm_assignee.properties.userName}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow2\' \r\n        sourceRef=\'adhocTask\'\r\n            targetRef=\'verifyTaskDone\' />\r\n\r\n        <userTask id=\"verifyTaskDone\" name=\"Verify Adhoc Task Completed.\"\r\n            activiti:formKey=\"wf:completedAdhocTask\" >\r\n            <documentation>\r\n                Verify the arbitrary task was completed.\r\n            </documentation>\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowDueDate != \'undefined\') task.dueDate = bpm_workflowDueDate\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                        \r\n                        if (wf_notifyMe)\r\n			            {\r\n			               var mail = actions.create(\"mail\");\r\n			               mail.parameters.to = initiator.properties.email;\r\n			               mail.parameters.subject = \"Adhoc Task \" + bpm_workflowDescription;\r\n			               mail.parameters.from = bpm_assignee.properties.email;\r\n			               mail.parameters.text = \"It\'s done\";\r\n			               mail.execute(bpm_package);\r\n			            }\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n           </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n        <sequenceFlow id=\'flow3\' sourceRef=\'verifyTaskDone\'\r\n            targetRef=\'theEnd\' />\r\n\r\n        <endEvent id=\"theEnd\" />\r\n\r\n   </process>\r\n\r\n   <!-- Graphical representaion of diagram -->\r\n   <bpmndi:BPMNDiagram id=\"BPMNDiagram_activitiAdhoc\">\r\n      <bpmndi:BPMNPlane bpmnElement=\"activitiAdhoc\" id=\"BPMNPlane_activitiAdhoc\">\r\n         <bpmndi:BPMNShape bpmnElement=\"start\"\r\n            id=\"BPMNShape_start\">\r\n            <omgdc:Bounds height=\"35\" width=\"35\" x=\"30\" y=\"200\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"adhocTask\"\r\n            id=\"BPMNShape_adhocTask\">\r\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"130\"\r\n               y=\"190\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"verifyTaskDone\"\r\n            id=\"BPMNShape_verifyTaskDone\">\r\n            <omgdc:Bounds height=\"55\" width=\"105\" x=\"290\"\r\n               y=\"190\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNShape bpmnElement=\"theEnd\"\r\n            id=\"BPMNShape_theEnd\">\r\n            <omgdc:Bounds height=\"35\" width=\"35\" x=\"455\" y=\"200\"></omgdc:Bounds>\r\n         </bpmndi:BPMNShape>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow1\" id=\"BPMNEdge_flow1\">\r\n            <omgdi:waypoint x=\"65\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"130\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow2\" id=\"BPMNEdge_flow2\">\r\n            <omgdi:waypoint x=\"235\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"290\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n         <bpmndi:BPMNEdge bpmnElement=\"flow3\" id=\"BPMNEdge_flow3\">\r\n            <omgdi:waypoint x=\"395\" y=\"217\"></omgdi:waypoint>\r\n            <omgdi:waypoint x=\"455\" y=\"217\"></omgdi:waypoint>\r\n         </bpmndi:BPMNEdge>\r\n      </bpmndi:BPMNPlane>\r\n   </bpmndi:BPMNDiagram>\r\n\r\n</definitions>'),('20',1,'feba405f-a623-4883-9794-94f756232113bpmn20.xml','19','<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\r\n   xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\r\n   xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\r\n   xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\r\n   expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"http://alfresco.org\">\r\n\r\n   <process id=\"activitiInvitationNominated\" name=\"Nominated activiti invitation process\">\r\n\r\n      <startEvent id=\"start\" activiti:formKey=\"inwf:inviteToSiteTask\" />\r\n\r\n      <sequenceFlow id=\"flow1\" sourceRef=\"start\" targetRef=\"sendInvite\" />\r\n      \r\n      <serviceTask id=\"sendInvite\" name=\"Send Invite\" activiti:delegateExpression=\"${SendNominatedInviteDelegate}\" />\r\n      \r\n      <sequenceFlow id=\"flow2\" sourceRef=\"sendInvite\" targetRef=\"invitePending\" />\r\n\r\n      <userTask id=\"invitePending\" name=\"Invite Pending\"\r\n         activiti:formKey=\"inwf:activitiInvitePendingTask\">\r\n         <extensionElements>\r\n            <activiti:taskListener event=\"create\"\r\n               class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     if (typeof bpm_workflowDueDate != \'undefined\')\r\n                        task.setVariable(\'bpm_dueDate\', bpm_workflowDueDate);\r\n                     if (typeof bpm_workflowPriority != \'undefined\') \r\n                        task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n            <activiti:taskListener event=\"complete\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n               <activiti:field name=\"script\">\r\n                  <activiti:string>\r\n                     execution.setVariable(\'inwf_inviteOutcome\', task.getVariable(\'inwf_inviteOutcome\'));\r\n                  </activiti:string>\r\n               </activiti:field>\r\n            </activiti:taskListener>\r\n         </extensionElements>\r\n         <humanPerformer>\r\n            <resourceAssignmentExpression>\r\n                <formalExpression>${bpm_assignee.properties.userName}</formalExpression>\r\n            </resourceAssignmentExpression>\r\n         </humanPerformer>\r\n      </userTask>\r\n      \r\n      <sequenceFlow id=\"flow3\" sourceRef=\"invitePending\" targetRef=\"inviteGateway\" />\r\n\r\n      <exclusiveGateway id=\"inviteGateway\" name=\"Invite Gateway\" /> \r\n\r\n      <sequenceFlow id=\"flow4\" sourceRef=\"inviteGateway\" targetRef=\"accepted\">\r\n          <conditionExpression xsi:type=\"tFormalExpression\">${inwf_inviteOutcome == \'accept\'}</conditionExpression>\r\n      </sequenceFlow>\r\n      \r\n      <sequenceFlow id=\"flow5\" sourceRef=\"inviteGateway\" targetRef=\"rejected\">\r\n          <conditionExpression xsi:type=\"tFormalExpression\">${inwf_inviteOutcome == \'reject\'}</conditionExpression>\r\n      </sequenceFlow>\r\n      \r\n      <sequenceFlow id=\"flow7\" sourceRef=\"inviteGateway\" targetRef=\"cancelled\" />\r\n      \r\n      <serviceTask id=\"accepted\" name=\"Accepted\" activiti:delegateExpression=\"${AcceptNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow6\" sourceRef=\"accepted\" targetRef=\"inviteAccepted\" />\r\n\r\n      <serviceTask id=\"rejected\" name=\"Rejected\" activiti:delegateExpression=\"${RejectNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow8\" sourceRef=\"rejected\" targetRef=\"inviteRejected\" />\r\n      \r\n      <serviceTask id=\"cancelled\" name=\"Cancelled\" activiti:delegateExpression=\"${CancelNominatedInviteDelegate}\" />\r\n      <sequenceFlow id=\"flow9\" sourceRef=\"cancelled\" targetRef=\"end\" />\r\n      \r\n       <userTask id=\"inviteAccepted\" name=\"Invitation Accepted\"\r\n            activiti:formKey=\"inwf:acceptInviteTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  </activiti:field>\r\n               </activiti:taskListener>\r\n            </extensionElements>\r\n            <humanPerformer>\r\n                <resourceAssignmentExpression>\r\n                    <formalExpression>${initiator.exists() ? initiator.properties.userName : \'admin\'}</formalExpression>\r\n                </resourceAssignmentExpression>\r\n            </humanPerformer>\r\n        </userTask>\r\n\r\n      <sequenceFlow id=\"flow10\" sourceRef=\"inviteAccepted\" targetRef=\"end\" />\r\n        \r\n       <userTask id=\"inviteRejected\" name=\"Invitation Rejected\"\r\n            activiti:formKey=\"inwf:rejectInviteTask\" >\r\n            <extensionElements>\r\n               <activiti:taskListener event=\"create\" class=\"org.alfresco.repo.workflow.activiti.tasklistener.ScriptTaskListener\">\r\n                  <activiti:field name=\"script\">\r\n                     <activiti:string>\r\n                        if (typeof bpm_workflowPriority != \'undefined\') task.priority = bpm_workflowPriority;\r\n                     </activiti:string>\r\n                  <